1Unya si Job mitubag ug miingon: 2Ah, kong gitimbang pa lamang unta ang akong pag-agulo, Ug gipahaluna sa timbangan ang tanan ko nga kagul-anan! 3Kay karon kini mabug-at labi pa kay sa balas sa mga dagat: Busa, nahinanali ang akong mga pulong. 4Kay ang pana sa Makagagahum kanako mingtaroy, Ug sa hilo niana ang akong kalag nagainum: Ug ang mga kalisang sa Dios nakiggubat batok kanako. 5Magabihihi ba ang asnong ihalas kong siya may balili? Kun magainga ba ang vaca sa ibabaw sa iyang kompay? 6Ang b
..........
 kanako nga mga malimbongon sama sa usa ka sapa, Sama sa tubig sa kasapaan nga mangagi sa madali; 16Nga maitum tungod sa yelo, Ug diin ang nieve magatago. 17Sa panahon nga sila mainit-init, sila mangawala, Sa mating-init, mangawagtang sila sa ilang dapit. 18Ang mga magbabaklay nga nangagi sa ilang dalan managlikay; Sila mangadto sa kausikan, ug mangawagtang. 19Ang mga panon sa mga magbabaklay sa Teman mingtan-aw, Ang mga kapundokan sa Saba minghulat kanila. 20Sila gipakaulawan kay sila minglaum;
